Information
------------------------------

Wild Scotland: The Western Isles
At the edge of the Atlantic lies a land of rock and water. Wind-scoured and rugged yet full of beauty. The islands of the Hebrides are a superb place for wildlife. In a world of towering cliffs, white-sand beaches and cold clear seas lives an unforgettable cast of wild animals - otters, eagles and red deer, seals, dolphins and basking sharks. But living here isn't easy. Battered by a wild ocean and some of Europe's most unpredictable weather, the only certainty here is constant change. Delivering a compelling portrait of a year in these Islands on the Edge, rich in emotional animal stories and photographed by the world's best camera talent a series to remember.&quot;aka Hebrides: Islands on the Edge&quot;


1)  Part 1 
Scotland's Hebrides are Europe's final frontier against the wild and unpredictable Atlantic Ocean. This landmark wildlife series, narrated by Ewan McGregor, introduces an unforgettable wild animal cast struggling to survive here on these Islands on the Edge. In this first episode Autumn arrives with a vengeance.

2)  Part 2 
Of all the Western Isles, the Outer Hebrides are the most exposed to the full power of the Atlantic. And the wildlife here is the most spectacular in Europe. Seabirds rush to feed their hungry chicks while avoiding bonxies predatory skuas with a taste for young puffins

3)  Part 3 
In most years winter is the hardest time in the Hebrides but once in a generation the spring turns out to be harder still. In this episode of this landmark series, the Islands on the Edge are hit by the biggest storm in living memory.

